INSERT INTO `field_text` (`pages_id`, `data`) VALUES('1', '<p><img alt=\"logo\" class=\"align_center\"	src=\"/site/assets/files/1/400dpilogo-1.700x0-is.png\" width=\"700\" /></p>\n\n<p>WAS WÄRE, <strong>WENN LERNEN GANZ VON SELBST GINGE?</strong></p>\n\n<p>Ich liebe es, mit Menschen zu arbeiten. Vor allem aber liebe ich meine zwei wundervollen Töchter, die mir die Tür zur Kinderwelt geöffnet und Nahe gebracht haben. Dank ihnen bin ich zur Evolutionspädagogik gekommen, in der ich meine Erfüllung gefunden habe. Warum? Die Schwerpunkte und Ziele der Evolutionspädagogik stimmen mit meinen persönlichen Wertvorstellungen im Leben überein.</p>\n\n<p><strong>Es gibt nichts Wichtigeres im Leben als ein glückliches Kind!</strong></p>\n\n<p>Die Stärke der Evolutionspädagogik liegt in ihrer Einfachheit. Der Mensch und dessen Entstehung stehen im Mittelpunkt. Die Evolutionspädagogik benutzt in erster Linie die evolutiven Entwicklungsschübe der Lebewesen, die sowohl im Gehirn als auch im Körper gespeichert sind. Bei „Stress“ (Blockade) sendet das Gehirn dem Körper Signale und zeigt sich im körperlichen und geistigen Ungleichgewicht. Probleme, Verhaltensmuster und Defizite können somit gezielt aufgedeckt und Talente und Fähigkeiten gefördert werden. Die Entfaltung unserer Talente führt uns letztendlich zu der Antwort auf unsere Frage:</p>\n\n<p><strong>„Wer bin ich und was macht mich aus?“</strong></p>');
